import React from 'react'
import Avatar from '@mui/material/Avatar';
import boy from '../component/assets/Ezz.png';
import Button from '@mui/material/Button';
import SettingsOutlinedIcon from '@mui/icons-material/SettingsOutlined';
import PropTypes from 'prop-types';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';


import "./profile.css"
function CustomTabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`simple-tabpanel-${index}`}
        aria-labelledby={`simple-tab-${index}`}
        {...other}
      >
        {value === index && (
          <Box sx={{ p: 3 }}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    );
  }

  CustomTabPanel.propTypes = {
    children: PropTypes.node,
    index: PropTypes.number.isRequired,
    value: PropTypes.number.isRequired,
  };

  function a11yProps(index) {
    return {
      id: `simple-tab-${index}`,
      'aria-controls': `simple-tabpanel-${index}`,
    };
  }


export default function Profile() {

    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
      setValue(newValue);

    return (
    <div id="profile">
        <div id="top">
        <Avatar id="img" sx={{width:160,height:160}} src={boy}/>

        <h2 id="name">Ezz_Kalash</h2>
        <Button id="butt" variant="contained" >Edit Profile</Button>
            <Button id="butt" variant="contained">View actions</Button>
            <img src={SettingsOutlinedIcon} alt="" />

            <div id="stats">
            <p id="p">5 Posts</p>
            <p id="p">211 follower</p>
            <p id="p">300 Following</p>
            </div>
            <div id="bio">
            <p id="p">ezzalden kalash</p>
            <p id="p">CSE | AAUP</p>
            </div>

            <Box sx={{ width: '100%' }}>
      <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
        <Tabs value={value} onChange={handleChange} aria-label="basic tabs example">
          <Tab label="Item One" {...a11yProps(0)} />
          <Tab label="Item Two" {...a11yProps(1)} />
          <Tab label="Item Three" {...a11yProps(2)} />
        </Tabs>
      </Box>
      <CustomTabPanel value={value} index={0}>
        Item One
      </CustomTabPanel>
      <CustomTabPanel value={value} index={1}>
        Item Two
      </CustomTabPanel>
      <CustomTabPanel value={value} index={2}>
        Item Three
      </CustomTabPanel>
    </Box>
        </div>

        </div>
  )
}}
